import React from 'react';
import SortingVisualizer from './SortingVisualizer/SortingVisualizer';
import CollisionVisualizer from './CollisionVisualizer/CollisionVisualizer';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="App-nav">Data Structures and Algorithms</div>
      <div className="container1"><SortingVisualizer></SortingVisualizer></div>
      <div className="container2"></div><CollisionVisualizer></CollisionVisualizer>
    </div>
  );
}

export default App;
